import React from "react"


const Modal = ({setPullId, pullId, setModal, tableData, CarsM, PullsM}) => {

   return(   <CarsM setPullId={setPullId} {...{pullId, setModal, tableData}}/>,
             <PullsM setPullId={setPullId} {...{pullId, setModal, tableData}}/>  
   )
}

export default Modal;
